import React from 'react';

const Soundscape = () => {
  const soundscapes = ['Music', 'Nature', 'Rain', 'Celestial', 'Beach', 'Chimes', 'Storm', 'White Noise'];
  
  return (
    <div className="soundscape-container">
      <h2>Soundscape</h2>
      <div className="soundscape-options">
        {soundscapes.map((soundscape, index) => (
          <button key={index}>{soundscape}</button>
        ))}
      </div>
    </div>
  );
};

export default Soundscape;
